('e12bc7ed-4460dfe2-9974916c', 'Tuyệt vời! Phim có cốt truyện gây cấn và diễn xuất xuất sắc. Mình đã bị lôi cuốn từ đầu đến cuối. Đây là một trong những bộ phim hay nhất mà tôi từng xem.', '2023-06-15 21:07:19.101000', 0, 0, 5, '2023-06-15 21:07:19.101000', 11, 'baf537e3-ee782072-6f273b97'),
('e147ceba-7302ad89-2fd0303b', 'Tuyệt vời! Đây là một trong những bộ phim xuất sắc nhất mà tôi từng xem. Cốt truyện thông minh và diễn xuất ấn tượng. Đáng để dành thời gian để xem!', '2023-06-15 21:07:19.800000', 0, 0, 5, '2023-06-15 21:07:19.800000', 18, 'baf537e3-ee782072-6f273b97'),
('e1ddf6d9-6b4dbf68-6311f712', 'Tuyệt vời! Đây là một trong những bộ phim xuất sắc nhất mà tôi từng xem. Cốt truyện thông minh và diễn xuất ấn tượng. Đáng để dành thời gian để xem!', '2023-06-15 21:07:19.534000', 0, 0, 5, '2023-06-15 21:07:19.534000', 15, 'baf537e3-ee782072-6f273b97'),
('e3001214-e6ed2fc3-25504ff2', 'Tuyệt vời! Phim có cốt truyện sâu sắc và ý nghĩa. Diễn xuất xuất sắc và tạo hình nhân vật độc đáo. Mình đã yêu thích từ đầu đến cuối!', '2023-06-15 21:07:18.534000', 0, 0, 5, '2023-06-15 21:07:18.534000', 4, 'baf537e3-ee782072-6f273b97'),
('e3695b39-6fb7419c-b902a8f0', 'Tuyệt vời! Đây là một trong những bộ phim xuất sắc nhất mà tôi từng xem. Cốt truyện thông minh và diễn xuất ấn tượng. Đáng để dành thời gian để xem!', '2023-06-15 21:07:18.976000', 0, 0, 5, '2023-06-15 21:07:18.976000', 9, 'baf537e3-ee782072-6f273b97'),
('e6462277-0543e5f4-4349015d', 'Không thích phim này lắm. Cốt truyện tẻ nhạt và diễn xuất kém. Mình không thấy hứng thú khi xem.', '2023-06-15 21:07:18.410000', 0, 0, 2, '2023-06-15 21:07:18.410000', 3, 'baf537e3-ee782072-6f273b97'),
('e82a1bb1-6e0e71da-d9bef7c5', 'Phim này khá ổn. Mình đã có những giây phút giải trí và cảm thấy thoải mái khi xem nó. Nếu bạn muốn xem một bộ phim nhẹ nhàng, hãy thử ngay!', '2023-06-15 21:07:18.333000', 0, 0, 3, '2023-06-15 21:07:18.333000', 2, 'baf537e3-ee782072-6f273b97'),
('e8f14381-443f9e60-7783a284', 'Phim này không phải là sở thích của tôi. Cốt truyện chưa thực sự cuốn hút và diễn xuất cũng không ấn tượng. Tôi hy vọng có nhiều bộ phim tốt hơn để xem.', '2023-06-15 21:07:18.943000', 0, 0, 2, '2023-06-15 21:07:18.943000', 9, 'baf537e3-ee782072-6f273b97');
