INSERT INTO `movie` (`id`, `actors`, `country`, `created_at`, `description`, `duration_in_mins`, `image`, `language`, `large_image`, `last_updated`, `release_date`, `title`, `trailer`) VALUES
(1, 'Chris Pratt, Zoe Saldana, Dave Bautista, Karen Gillan, Pom Klementieff', 'US', '2023-06-19 11:57:19.338000', 'Nhóm Vệ binh dải Ngân Hà sau khi chia tay Thor và Gamora, đã mua lại xứ Knowhere từ chủ cũ Tivan, rồi thành lập trụ sở chính của họ ở đây.[a] Không lâu sau đó, họ bị tấn công bởi Adam Warlock, kẻ mạnh nhất được tạo ra bởi nữ hoàng Sovereign Ayesha. Bởi vì trong phần 2, cha con Peter Quill đã đánh tan tành phi đội tàu chiến của Ayesha, nên mụ thù dai và đã giành một chiếc kén từ bộ sưu tập Tivan và nhận nuôi đứa bé sinh ra từ đó, đặt tên Adam Warlock và lợi dụng Adam làm bảo kê.', 149, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736293549346856/129aeeb6-6ae6-4b4b-b4e1-5f38dd1e9bc6.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120198666817380402/photo-1-1540018246468599888897.png', '2023-06-19 11:57:19.338000', '03/05/2023', 'Vệ Binh Dải Ngân Hà 3', 'https://www.youtube.com/watch?v=u3V5KDHRQvk'),
(2, 'Thái Hoà, Thu Trang', 'US', '2023-06-19 11:57:19.374000', 'Lấy cảm hứng từ web drama Chuyện Xóm Tui, phiên bản điện ảnh sẽ mang một màu sắc hoàn toàn khác: hài hước hơn, gần gũi và nhiều cảm xúc hơn Bộ phim là câu chuyện của Nhót - người phụ nữ “chưa kịp già” đã sắp bị mãn kinh, vội vàng đi tìm chồng. Nhưng sâu thẳm trong cô, là khao khát muốn có một đứa con và luôn muốn hàn gắn với người cha suốt ngày say xỉn của mình.', 112, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736308749508658/tFMjE2A.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120199748780044379/339440745_953868245642419_1190126796390971936_n.png', '2023-06-19 11:57:19.374000', '28/04/2023', 'Con Nhót Mót Chồng', 'https://www.youtube.com/watch?v=Zu2z-SY3hCk'),
(3, 'Pachrapa Chaichua, Pongsak Pongsuwan, Ananda Everingham, Rusameekae Fagerlund, Napapa Thantrakul', 'US', '2023-06-19 11:57:19.395000', 'Dựa trên truyền thuyết về nàng Nak, không xuất hiện trong lịch sử - Tid Noi là câu chuyện khai thác về một nhân vật mới trong mối quan hệ giữa Pee Mak và Mae Nak. Khác với suy đoán về một chuyện tình tay ba ngang trái, Tid Noi đơn thuần là anh bạn hàng xóm mang trong mình tình yêu đơn phương thuần khiết dành cho cô gái nhà bên là Nak.', 104, 'https://cdn.discordapp.com/attachments/1058632154696921108/1120200232853057607/tinh-nguoi-duyen-ma-ngoai-truyen-1094241.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120199976304267294/maxresdefault.png', '2023-06-19 11:57:19.395000', '05/05/2023', 'Tình Người Duyên Ma: Ngoại Truyện', 'https://www.youtube.com/watch?v=6oztXW8xqHk'),
(4, 'Olivia Cooke, Kenneth Branagh, William Shatner, Laurie Holden, Kevin Dennis', 'US', '2023-06-19 11:57:19.412000', 'Cô Bé Cứu Hoả (tên tiếng Anh: Fireheart) đưa người xem bước vào hành trình phiêu lưu kỳ thú của Georgia Nolan - một cô bé thông minh, nhiệt huyết với ước mơ trở thành lính cứu hoả như ba mình. Tuy nhiên, năm 1932 tại New York, phụ nữ không được phép làm công việc này. Nhưng cơ hội “vàng” đã đến khi Georgia nảy ra ý định cải trang thành Joe - một chàng trai vụng về gia nhập đội cứu hoả do chính ba mình thành lập. Vừa phải bảo vệ danh tính thật, vừa phải dấn thân vào phi vụ mạo hiểm: Giải cứu những người lính cứu hoả của thành phố đã lần lượt biến mất trong ngọn lửa bí ẩn thiêu rụi Nhà hát Broadway, liệu Georgia có dũng cảm vượt qua tất cả và thành công?', 92, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736407181426698/co-be-cuu-hoa.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120200473014698004/maxresdefault.png', '2023-06-19 11:57:19.412000', '12/05/2023', 'Cô Bé Cứu Hỏa', 'https://www.youtube.com/watch?v=3suZMzK8Uu4'),
(5, 'Kim Bo-ra, Kim Jae-hyun, Shin So-yul', 'US', '2023-06-19 11:57:19.425000', 'Lời đồn ma ám về nhà ga Oksu ngày càng nhiều khi những vụ án kinh hoàng liên tục xảy ra. Một đường ray cũ kỹ, một chiếc giếng bỏ hoang, những con số gây ám ảnh hay những vết thương kỳ dị trên thi thể người xấu số... Tất cả dẫn đến một bí mật đau lòng bị chôn vùi nhiều năm trước.', 80, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736488135696424/kisagari_poster.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120200686429290596/maxresdefault.png', '2023-06-19 11:57:19.425000', '28/04/2023', 'Trạm Tàu Ma', 'https://www.youtube.com/watch?v=gHeWP9R6-eU'),
(6, 'Vasiliy Rovenskiy', 'US', '2023-06-19 11:57:19.440000', 'Câu chuyện xoay quanh tình bạn của chú mèo Vincent và chú chuột Maurice. Vincent vừa nhận được công việc bảo vệ kiệt tác tranh Mona Lisa trong một viện bảo tàng, còn Maurice lại có niềm đam mê gặm nhấm bức tranh này. Mọi chuyện phức tạp hơn khi có người cũng đang nung nấu ý định cướp lấy tuyệt tác Mona Lisa. Liệu Vincent và đồng đội của mình có thể cứu lấy những kiệt tác của Davinci và bảo vệ danh cho bảo tàng không?', 80, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736559338192896/meo-vie-ao-tag.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120200976020815942/maxresdefault.png', '2023-06-19 11:57:19.440000', '28/04/2023', 'Mèo Siêu Quậy Ở Viện Bảo Tàng', 'https://www.youtube.com/watch?v=8luiie842wA'),
(7, 'Jake Gyllenhaal, Dar Salim, Antony Starr, Alexander Ludwig, Emily Beecham', 'US', '2023-06-19 11:57:19.457000', 'Trong nhiệm vụ cuối cùng ở Afghanistan, Trung sĩ John Kinley cùng đội với phiên dịch viên bản địa Ahmed. Khi đơn vị của họ bị phục kích, Kinley và Ahmed là 2 người sống sót duy nhất. Bị kẻ địch truy đuổi, Ahmed liều mạng đưa Kinley đang bị thương băng qua nhiều dặm đường địa hình khắc nghiệt đến nơi an toàn. Trở về Mỹ, Kinley biết rằng Ahmed và gia đình không dc cấp giấy thông hành tới Mỹ như đã hứa. Quyết tâm bảo vệ bạn mình và đền ơn cứu mạng, Kinley trở lại chiến trường để giúp Ahmed và gia đình trước khi lực lượng phiến quân phát hiện ra họ.', 123, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106239014870204547/poster_payoff_khe_uoc_12.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120201367785570415/maxresdefault.png', '2023-06-19 11:57:19.457000', '21/04/2023', 'Khế Ước', 'https://www.youtube.com/watch?v=02PPMPArNEQ'),
(8, 'Park Sung-woong, Lee Yi-kyung, Yeom Hye-ran, Oh Dal-Su, Choi Min-soo', 'US', '2023-06-19 11:57:19.472000', 'Phim Đầu Gấu Đụng Đầu Đất dựa trên câu chuyện thần thoại nổi tiếng tại Hàn Quốc về hai chú gấu sinh đôi hoá thành người sau khi ăn tỏi và ngải cứu trong 100 ngày. Chú gấu ăn tỏi trở thành Na Woong-nam, được một cặp vợ chồng nhà khoa học mang về nuôi nấng, tuy chỉ mới 25 tuổi nhưng lại sở hữu “giao diện” của một ông chú 52 với cái “đầu đất” ngây thơ, hiền lành. Trong khi đó, chú gấu ăn ngải cứu trở thành “đầu gấu” Lee Jeong-hak, được một tên trùm tổ chức tội phạm mang về nuôi và bị lợi dụng như một món “vũ khí” phòng vệ. Trong một tình huống bất đắc dĩ, Na Woong-nam đã trực tiếp đối đầu cùng anh em song sinh Lee Jeong-hak để ngăn chặn một vụ khủng bố virus có tầm lây lan mạnh. Sức mạnh của loài gấu bộc phát sẽ đẩy cuộc đụng độ của cặp gấu song sinh hoá người đi đến hồi kết nào?', 98, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736697163026512/dau-gau-gap-dau-dat.png', 'VN', '', '2023-06-19 11:57:19.472000', '21/04/2023', 'Đầu Gấu Gặp Đầu Đất', 'https://www.youtube.com/watch?v=nPSGk6ZInrg'),
(9, 'John Francis Daley, Jonathan M. Goldstein', 'US', '2023-06-19 11:57:19.489000', 'Theo chân một tên trộm quyến rũ và một nhóm những kẻ bịp bợm nghiệp dư thực hiện vụ trộm sử thi nhằm lấy lại một di vật đã mất, nhưng mọi thứ trở nên nguy hiểm khó lường hơn bao giờ hết khi họ đã chạm trán nhầm người. Ngục Tối Và Rồng: Danh Dự Của Kẻ Trộm mang thế giới huyền ảo của trò chơi nhập vai huyền thoại lên màn ảnh rộng bằng một cuộc phiêu lưu tràn ngập các màn hành động đã mắt cùng màu sắc hài hước, vui nhộn.', 134, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736771150549103/700x1000___2.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120201832120197140/Dungeons-Dragons-3423d.png', '2023-06-19 11:57:19.489000', '21/04/2023', 'Ngục Tối Và Rồng: Danh Dự Của Kẻ Trộm', 'https://www.youtube.com/watch?v=IiMinixSXII'),
(10, 'Chris Pratt, Anya Taylor-Joy, Charlie Day, Jack Black, Keegan-Michael Key', 'US', '2023-06-19 11:57:19.509000', 'Đây là bộ phim chuyển thể thứ ba của thương hiệu này, sau bộ phim hoạt hình Nhật Bản Super Mario Bros.: Nhiệm vụ vĩ đại giải cứu công chúa Peach! (1986) và bộ phim điện ảnh người đóng Super Mario Bros. (1993). Do Aaron Horvath và Michael Jelenic làm đạo diễn, Pierre Leduc và Fabien Polack làm đồng đạo diễn và được Matthew Fogel chắp bút phần biên kịch, bộ phim có dàn diễn viên lồng tiếng bao gồm Chris Pratt, Anya Taylor-Joy, Charlie Day, Jack Black, Keegan-Michael Key, Seth Rogen, Fred Armisen, Sebastian Maniscalco, Charles Martinet và Kevin Michael Richardson. Tác phẩm theo chân hai anh em mang tên Mario và Luigi, hai anh thợ sửa ống nước người Mỹ gốc Ý được chuyển đến một thế giới khác và bị vướng vào trận chiến giữa Vương quốc Nấm, do Công chúa Peach lãnh đạo và Koopas, do Bowser lãnh đạo.', 93, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736836598485082/1200wx1800h-1-1680765880-poster.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120202072546082926/maxresdefault.png', '2023-06-19 11:57:19.509000', '07/04/2023', 'Anh Em Super Mario', 'https://www.youtube.com/watch?v=TnGl01FkMMo'),
(11, 'Penelope Sangiorgi, Rocco Marazzita, Lucia Caporaso, Daniele De Martino, Chiara Casolari', 'US', '2023-06-19 11:57:19.526000', 'Sau cái chết của cha, Emma (Penelope Sangiorgi) vội vã bay từ New York về quê nhà ở Ý để lo hậu sự. Trong thời gian diễn ra tang lễ, Emma ở một mình trong căn nhà mà cha mẹ để lại. Lúc này, cô bị buộc phải đối mặt với một thực thể tà ác có khả năng kết nối thông qua một chiếc radio bị nguyền rủa. Để sống sót và bảo vệ những người mình yêu thương, Emma phải tìm ra bí mật đen tối ẩn sau chiếc radio ma quỷ kia…', 93, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736900960079973/Am-Vuc-Chet-Sound-of-Silence-2023-poster.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120202427300327505/xem-phim-am-vuc-chet.png', '2023-06-19 11:57:19.526000', '21/04/2023', 'Âm Vực Chết', 'https://www.youtube.com/watch?v=239gO3anEwE'),
(12, 'Sarah Grey, Meg Foster, Sarah Dumont, Alexis Knapp, Mena Suvari', 'US', '2023-06-19 11:57:19.536000', 'Câu chuyện bắt đầu khi Elly được gia đình của một người bạn nhờ chăm sóc một người phụ nữ lớn tuổi sống trong một căn nhà gỗ hẻo lánh trong vài ngày. Nhận lời đồng ý, nhưng sau đó Elly phát hiện ra sự xuất hiện của một con quỷ đang ẩn náu trong người phụ nữ chỉ chực chờ để thoát ra. Cùng lúc đó, những bí ẩn về cái chết của mẹ cô dần dần được gợi mở bởi những cơn ác mộng mà Elly phải trải qua.', 96, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105736973521534996/con-thinh-no-tu-coi-am-1094250.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120202639930560612/maxresdefault.png', '2023-06-19 11:57:19.536000', '12/05/2023', 'Cơn Thịnh Nộ Từ Cõi Âm', 'https://www.youtube.com/watch?v=Ry2lqIHcURY'),
(13, 'Jorma Tommila, Aksel Hennie, Jack Doolan, Onni Tommila, Mimosa Willamo', 'US', '2023-06-19 11:57:19.550000', 'Lấy bối cảnh năm 1944, SISU kể câu chuyện về một cựu binh phát hiện ra mỏ vàng trong vùng hoang dã của Phần Lan. Trên đường vào thành phố bán vàng, những tên lính Phát Xít tàn bạo đang thực hiện nhiệm vụ tàn phá khắp nơi đã phát hiện ra kho báu và cướp lấy nó từ tay anh ta. Cựu binh quyết tâm đòi lại tất cả, từ nợ cho đến thù, thậm chí nếu điều đó có nghĩa là giết hết tất cả lính Phát Xít.', 91, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105737028894736445/sisu.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120202811775406200/1920x1000_1_1_.png', '2023-06-19 11:57:19.550000', '12/05/2023', 'Sisu: Già Gân Báo Thù', 'https://www.youtube.com/watch?v=2NnPzpuU5ao'),
(14, 'Ben Affleck, Alice Braga, William Fichtner, J. D. Pardo, Jeff Fahey', 'US', '2023-06-19 11:57:19.567000', 'Phim theo chân thám tử Daniel Rourke (Ben Affleck) trong hành trình tìm kiếm cô con gái bị mất tích. Anh sớm nhận ra tất cả những chuyện bí ẩn này đều liên quan đến một người đàn ông có sức mạnh thôi miên. Với sự hỗ trợ từ nhà ngoại cảm Diana Cruz (Alice Braga), Daniel bắt đầu truy đuổi hắn và phải tìm mọi cách để đưa con gái mình trở về nhà an toàn.', 93, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105737099354853407/nhung-ke-thao-tung.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120203447753523240/341675557_1373095650148226_5090936415944190301_n.png', '2023-06-19 11:57:19.567000', '12/05/2023', 'Những Kẻ Thao Túng', 'https://www.youtube.com/watch?v=eHsWYmnXk1o'),
(15, 'Vin Diesel, Michelle Rodriguez, Tyrese Gibson, Ludacris, Jason Momoa', 'US', '2023-06-19 11:57:19.581000', 'Trở lại sau hai năm, Fast & Furious 10 - còn có tên Fast X - là một trong những bom tấn của mùa phim hè. Tác phẩm tạo được sự quan tâm lớn khi là phần mở đầu trong hai phim sẽ khép lại series hành động nổi tiếng sau hơn 20 năm. Phim bắt đầu với sự kiện diễn ra năm 2011, khi Dominic (Vin Diesel) - nhân vật chính - cùng đồng đội cướp tài sản của ông trùm Hernán Reyes. Sau vụ đụng độ, Hernan Reyes thiệt mạng nhưng con trai của lão - Dante Reyes (Jason Momoa) - ghi nhớ mối thù, lập kế hoạch trả đũa Dominic và gia đình anh. Nhiều năm sau, Dante tái xuất với nhiều đồng minh, lên kế hoạch hại con trai tám tuổi của nam chính.', 130, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106238898151096371/74d035165134327.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120203757226053632/gr9KBOV.png', '2023-06-19 11:57:19.581000', '17/05/2023', 'Fast & Furious 10', 'https://www.youtube.com/watch?v=aOb15GVFZxU'),
(16, 'Halle Bailey, Jonah Hauer-King, Daveed Diggs, Awkwafina, Jacob Tremblay', 'US', '2023-06-19 11:57:19.599000', 'Nàng Tiên Cá là câu chuyện được yêu thích về Ariel - một nàng tiên cá trẻ xinh đẹp và mạnh mẽ với khát khao phiêu lưu. Ariel là con gái út của Vua Triton và cũng là người ngang ngạnh nhất, nàng khao khát khám phá về thế giới bên kia đại dương. Trong một lần ghé thăm đất liền, nàng đã phải lòng Hoàng tử Eric bảnh bao. Trong khi tiên cá bị cấm tiếp xúc với con người, Ariel đã làm theo trái tim mình. Nàng đã thỏa thuận với phù thủy biển Ursula hung ác để cơ hội sống cuộc sống trên đất liền. Nhưng cuối cùng việc này lại đe dọa tới mạng sống của Ariel và vương miện của cha nàng.', 135, 'https://cdn.discordapp.com/attachments/1058632154696921108/1105737244410646528/nang-tien-ca-2-1679082319495.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120204202854064228/little-mermaid-poster.png', '2023-06-19 11:57:19.599000', '26/05/2023', 'Nàng Tiên Cá', 'https://www.youtube.com/watch?v=kpGo2_d3oYE'),
(17, 'Wasabi Mizuta, Megumi Oohara, Yumi Kakazu, Subaru Kimura, Tomokazu Seki', 'US', '2023-06-19 11:57:19.614000', 'Phần phim mới nhất xoay quanh chuyến phiêu lưu của Doraemon, Nobita và những người bạn thân tới Paradapia - một hòn đảo hình trăng lưỡi liềm lơ lửng trên bầu trời. Ở nơi đó, tất cả đều hoàn hảo… đến mức cậu nhóc Nobita mê ngủ ngày cũng có thể trở thành một thần đồng toán học, một siêu sao thể thao. Cả hội Doraemon cùng sử dụng một món bảo bối độc đáo chưa từng xuất hiện trước đây để đến với vương quốc tuyệt vời này. Cùng với những người bạn ở đây, đặc biệt là chàng robot mèo Sonya, cả hội đã có chuyến hành trình tới vương quốc trên mây tuyệt vời… cho đến khi những bí mật đằng sau vùng đất lý tưởng này được hé lộ.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106238634660728943/main_poster_-_dmmovie2023.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120204407791956078/maxresdefault.png', '2023-06-19 11:57:19.614000', '26/05/2023', 'Doraemon: Nobita Và Vùng Đất Lý Tưởng Trên Bầu Trời', 'https://www.youtube.com/watch?v=jyCSIPhNJGw'),
(18, 'Shameik Moore', 'US', '2023-06-19 11:57:19.633000', 'Miles Morales tái xuất trong phần tiếp theo của bom tấn hoạt hình từng đoạt giải Oscar - Spider-Man: Across the Spider-Verse. Sau khi gặp lại Gwen Stacy, chàng Spider-Man thân thiện đến từ Brooklyn phải du hành qua đa vũ trụ và gặp một nhóm Người Nhện chịu trách nhiệm bảo vệ các vũ trụ song song. Nhưng khi nhóm siêu anh hùng xung đột về cách xử lý một mối đe dọa mới, Miles buộc phải đọ sức với các Người Nhện khác và phải xác định lại ý nghĩa của việc trở thành một người hùng để có thể cứu những người cậu yêu thương nhất.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106239406718844968/SpidermanPOSTER-011.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120204572112195664/980x448_18_.png', '2023-06-19 11:57:19.633000', '01/06/2023', 'Người Nhện: Du Hành Vũ Trụ Nhện', 'https://www.youtube.com/watch?v=shW9i6k8cB0'),
(19, 'Anthony Ramos, Dominique Fishback, Tobe Nwigwe, Peter Cullen, Ron Perlman', 'US', '2023-06-19 11:57:19.648000', 'Một cuộc chiến với quy mô hoành tráng, những trận chiến căng thẳng, những cơn mưa lửa đạn tràn ngập giữa hàng loạt các robot ngang tài ngang sức dần được tiết lộ ở những khung hình cuối của đoạn trailer. Thế nhưng liệu sự kết hợp ăn ý giữa Autobots và Maximals liệu có đủ để chống lại cả một đội quân đông đảo của Scourge hay không, liệu có Transformer nào sẽ phải hy sinh ở cuộc chiến này? Hay phải chăng sẽ còn cách nào khác để cứu Trái Đất như lời Elena hé lộ?', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106238526716125314/tf7_700x1000.png', 'VN', 'https://media.discordapp.net/attachments/1058632154696921108/1120204908008833024/maxresdefault.png?width=1193&height=671', '2023-06-19 11:57:19.648000', '09/06/2023', 'Transformers: Quái Thú Trỗi Dậy', 'https://www.youtube.com/watch?v=itnqEauWQZM'),
(20, 'Ezra Miller, Kiersey Clemons, Billy Crudup, Johnny Depp', 'US', '2023-06-19 11:57:19.665000', 'Câu chuyện của Flash bắt đầu khi Barry Allen (Ezra Miller thủ vai) sử dụng siêu năng lực của mình để du hành thời gian nhằm thay đổi những sự kiện trong quá khứ. Nhưng khi nỗ lực cứu lấy gia đình mình vô tình thay đổi tương lai, Barry bị kẹt lại trong một thực tại, nơi tướng Zod tái xuất và đe dọa hủy diệt tất cả, nhưng không có bất cứ siêu anh hùng nào đứng ra giải cứu… Trừ khi Barry có thể thuyết phục một Batman rất khác và giải cứu một cư dân Kryptonian đang bị cầm tù… dẫu có thể đó không phải người mà anh thực sự tìm kiếm. Để giải cứu thế giới hiện tại cũng như trở lại tương lai mình từng biết, niềm hy vọng duy nhất của Barry là phải chạy đua vì cuộc đời mình. Vậy nhưng, sự hy sinh tuyệt đối đó có là đủ để đưa thế giới về lại như ban đầu?', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106239864397103224/the-flash-movie-poster-ezra-miller-barry-allen.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120205446255489044/stretched-1920-1080-1302431.png', '2023-06-19 11:57:19.665000', '16/06/2023', 'Flash', 'https://www.youtube.com/watch?v=hebWYacbdvc'),
(21, 'Jennifer Lawrence, Andrew Barth Feldman, Laura Benanti, Matthew Broderick, Ebon Moss-Bachrach', 'US', '2023-06-19 11:57:19.679000', 'ội dung phim kể về một cô gái lẳng lơ, sống nay đây mai đó với đủ loại công việc. Cho đến một ngày, cô nhận lời của một cặp vợ chồng trung niên là quyến rũ cậu con trai 19 tuổi của họ. Cũng từ đây, hành trình của bà cô U40 đi cò cưa trai trẻ bắt đầu với bao tình huống éo le, khó đỡ.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106239984714907741/Vu-Em-Day-Yeu-No-Hard-Feelings-2023-poster.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120205935349072063/Harpers-Bazaar-Phim-No-Hard-Feelings-cua-Jennifer-Lawrence_04.png', '2023-06-19 11:57:19.679000', '23/06/2023', 'Vú Em Dạy “Yêu”', 'https://www.youtube.com/watch?v=P15S6ND8kbQ'),
(22, 'Harrison Ford', 'US', '2023-06-19 11:57:19.693000', 'Tác phẩm là phần thứ năm trong loạt phim Indiana Jones, tiếp nối câu chuyện sau Indiana Jones and the Kingdom of the Crystal Skull (2008). Với những câu chuyện phiêu lưu kỳ thú, Indiana Jones (Harrison Ford) là một trong những anh hùng huyền thoại của các khán giả thế hệ 7x và 8x. Indiana Jones 5 sẽ pha trộn giữa thực tế, hư cấu. Lần này Indiana Jones sẽ đối mặt với Đức quốc xã trong thời gian diễn ra cuộc chạy đua vào không gian như thế nào? Bộ phim hứa hẹn sẽ là một chuyến hành trình cuối cùng đáng nhớ của Indiana Jones và là lời chào tạm biệt tốt nhất dành cho nhân vật này trên màn ảnh.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106240080680587324/indiana-jones-vong-quay-dinh-menh-thumb.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120206316384833556/maxresdefault.png', '2023-06-19 11:57:19.693000', '30/06/2023', 'Indiana Jones & Vòng Quay Định Mệnh', 'https://www.youtube.com/watch?v=eQfMbSe7F2g'),
(23, 'Ty Simpkins, Patrick Wilson, Hiam Abbass, Sinclair Daniel, Andrew Astor', 'US', '2023-06-19 11:57:19.705000', 'Đã 10 năm trôi qua kể từ màn đối đầu quỷ dữ theo đúng nghĩa đen diễn ra ở Insidious 2, sang chấn từ sự việc vẫn âm ỉ, nhất là đối với Josh và con trai lớn Dalton của anh. Vì cả hai đã chọn quên đi quá khứ cũng như đè nén khả năng đặc biệt của bản thân, giờ trong tâm trí họ tồn tại một khoảng trống khiến hai cha con luôn cảm thấy bản thân như đang bị chìm trong sương mù và cơn ác mộng dai dẳng về cánh cửa đỏ họ không thể nhớ đã gặp ở đâu. Và hôm nay, khi Dalton chuẩn bị lên đường học đại học, những con quỷ quay về để hoàn thành chuyện còn dang dở năm nào. Tệ hơn, giờ hai cha con không có Elise hỗ trợ nữa.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106240371983392918/quyquyetcuadoPOSTER-01.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120206464804470805/maxresdefault.png', '2023-06-19 11:57:19.705000', '07/07/2023', 'Quỷ Quyệt Cửa Đỏ Vô Định', 'https://www.youtube.com/watch?v=ZuQuOnYnr3Q'),
(24, 'Margot Robbie', 'US', '2023-06-19 11:57:19.716000', 'Lấy bối cảnh tại \'Barbieland\' một xã hội tươi đẹp, đầy màu sắc với Kens và Barbies. Ken của Ryan Gosling, được cho là một \'thằng cực kỳ ngu ngốc\', rất mê Barbie, nhưng lại yêu thế giới thực, nơi mà có tất cả các lý do mà Barbie ghét (tiêu chuẩn về vẻ đẹp, giới tính,... ). Ken và Barbie rời \'Barbieland\' để đến thế giới thực và CEO Mattel (Will Ferrell) phải đuổi theo để đưa họ trở lại Barbieland.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106240470784413776/o1YxyJFVbQvqwfWnf6aVyjcUhcZ.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120206644043858000/maxresdefault.png', '2023-06-19 11:57:19.716000', '21/07/2023', 'Barbie', 'https://www.youtube.com/watch?v=GRyt3Ov4zz0'),
(25, 'Cillian Murphy, Emily Blunt, Florence Pugh, Matt Damon, Dane DeHaan', 'US', '2023-06-19 11:57:19.730000', 'Kịch bản của bộ phim dựa trên cuốn sách đoạt giải Pulitzer American Prometheus: The Triumph and Tragedy of J. Robert Oppenheimer, của Kai Bird và Martin J. Sherwin. Oppenheimer là bộ phim thuộc thể loại sử thi giật gân, với nhân vật trung tâm là J. Robert Oppenheimer, nhà vật lý lý thuyết người đứng đầu phòng thí nghiệm Los Alamos, thời kỳ Thế chiến II. Ông đóng vai trò quan trọng trong Dự án Manhattan, tiên phong trong nhiệm vụ phát triển vũ khí hạt nhân, và được coi là một trong những “cha đẻ của bom nguyên tử”.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106240615706005587/oppenheimer-poster-1658411601593.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120206871396089876/maxresdefault.png', '2023-06-19 11:57:19.730000', '21/07/2023', 'Oppenheimer', 'https://www.youtube.com/watch?v=bK6ldnjE3Y0'),
(26, 'Minami Takayama, Wakana Yamazaki, Rikiya Koyama, Megumi Hayashibara, Shuuichi Ikeda', 'US', '2023-06-19 11:57:19.744000', 'Lấy bối cảnh ở vùng biển gần đảo Hachijo-jima, Tokyo. Các kỹ sư khắp nơi trên thế giới đã tập hợp lại để vận hành toàn diện \'Phao Thái Bình Dương\' - một cơ sở ngoài khơi để kết nối các camera an ninh thuộc sở hữu của lực lượng cảnh sát toàn cầu. Một thử nghiệm về một \'công nghệ mới\' nhất định dựa trên hệ thống nhận dạng khuôn mặt đang được tiến hành ở đó.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106240703450861730/conantausatdenPOSTER-01.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120207210266492999/Conan-movie-26-1-game4v-1683595773-53.png', '2023-06-19 11:57:19.744000', '21/07/2023', 'Thám Tử Lừng Danh Conan: Tàu Ngầm Sắt Màu Đen', 'https://www.youtube.com/watch?v=UKoz2Xh3ojc'),
(27, 'Rosario Dawson, Chase W. Dillon, LaKeith Stanfield, Tiffany Haddish, Owen Wilson', 'US', '2023-06-19 11:57:19.758000', 'Không một sinh vật sống nào có thể liên tục chỉ tồn tại trong thế giới thực mà không hóa điên. Ngay cả chim sơn ca và châu chấu cũng được một số người cho là có biết mơ. Dinh thự Hill thì chẳng còn tỉnh táo nữa. Nó đứng một mình trên những ngọn đồi, lưu giữ bóng tối trong lòng. Nó đã đứng như vậy trong suốt tám mươi năm và có thể sẽ tiếp tục đứng vững thêm tám mươi năm nữa.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106240872040910939/rsz_haunted_mansion_teaser_poster.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120207692431106118/haunted-mansion-cast-disney-characters_v52qnN8.png', '2023-06-19 11:57:19.758000', '28/07/2023', 'Dinh Thự Ma Ám', 'https://www.youtube.com/watch?v=gartMjonTXc'),
(28, 'George Lopez', 'US', '2023-06-19 11:57:19.773000', 'Câu chuyện về nguồn gốc của Jaime Reyes trong nguyên tác khá đơn giản và dễ hiểu. Reyes là một cậu thiếu niên sống cùng gia đình, bao gồm cha mẹ và em gái, tại El Paso, Texas, Mỹ. Trong một ngày trên đường đi học về, cậu tình cờ nhặt được một vật thể kỳ lạ có hình giống một con bọ hung. Và tính tò mò đã khiến Reyes quyết định mang nó về nhà, mà không hề biết rằng điều này sẽ thay đổi cuộc sống và tương lai cậu mãi mãi.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106240970170826752/fjej3p5vsaefncy-1670085354902.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120208115313414205/Screenshot-2023-04-03-at-10.png', '2023-06-19 11:57:19.773000', '18/08/2023', 'Blue Beetle', 'https://www.youtube.com/watch?v=vS3_72Gb-bI'),
(29, 'Denzel Washington, Dakota Fanning, Gaia Scodellaro, David Denman, Eugenio Mastrandrea', 'US', '2023-06-19 11:57:19.787000', 'Sau khi phải tự tay tiêu diệt những người đồng đội cũ trong The Equalizer 2 (2018), Robert McCall (Denzel Washington) quyết định nghỉ hưu thực sự và chuyển đến sinh sống tại miền Nam nước Ý. Tại đây, ông dường như đã tìm thấy một quê nhà mới với cuộc sống bình yên bên cạnh những người dân hiếu khách. Thế nhưng, mỗi khi McCall muốn thoát khỏi quá khứ bạo lực thì rắc rối lại tự tìm đến ông. Một tổ chức mafia bắt đầu vươn vòi bạch tuộc với vùng quê này với hàng loạt các hoạt động phi pháp, giết người và thậm chí là khủng bố cảnh sát. Khi tính mạng của bạn bè bị đe dọa, Robert McCall buộc phải tái xuất để xóa số băng đảng tội phạm này mãi mãi.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106241024726151168/thienacdoidau-01.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120208285790912602/m4mjezid_1920x1080-thienacdoidau2.png', '2023-06-19 11:57:19.787000', '01/09/2023', 'Thiện Ác Đối Đầu 3', 'https://www.youtube.com/watch?v=19ikl8vy4zs'),
(30, 'Kenneth Branagh, Michelle Yeoh, Jamie Dornan, Tina Fey, Jude Hill', 'US', '2023-06-19 11:57:19.800000', 'Án Mạng Ở Venice được lấy cảm hứng từ cuốn tiểu thuyết Hallowe’en Party năm 1969 của Agatha Christie, nhưng vẫn chưa rõ nó sẽ bám sát nguyên tác đến mức nào. Nội dung được tóm gọn như sau: “Bây giờ đã nghỉ hưu và sống lưu vong tự áp đặt tại thành phố quyến rũ nhất thế giới, [Hercule] Poirot miễn cưỡng tham dự một buổi cầu hồn tại một cung điện bị ma ám, mục nát. Khi một trong những vị khách bị sát hại, viên thám tử bị đẩy vào một thế giới nham hiểm của bóng tối và bí mật.”', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106241116640120973/An-Mang-O-Venice-Haunting-in-Venice-2023-poster.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120208664024842250/A_Haunting_in_Venice_logo.png', '2023-06-19 11:57:19.800000', '15/09/2023', 'Án Mạng Ở Venice', 'https://www.youtube.com/watch?v=oRCKIP5paEU'),
(31, 'Timothee Chalamet, Zendaya, Rebecca Ferguson, Javier Bardem, Florence Pugh', 'US', '2023-06-19 11:57:19.814000', 'Dune chuyển thể từ tiểu thuyết nổi tiếng cùng tên của nhà văn Frank Herbert, xuất bản tại Việt Nam với tựa đề Xứ cát. Kịch bản theo chân công tước Paul Atreides (Timothée Chalamet đóng) trong hành trình sinh tử bảo vệ vận mệnh của cả thiên hà', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106241194754854953/Dune-2-Poster.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120208840613433384/Dune-2-screenplay-imax.png', '2023-06-19 11:57:19.814000', '03/11/2023', 'Dune 2', 'https://www.youtube.com/watch?v=Way9Dexny3w'),
(32, 'Anna Kendrick, Justin Timberlake, Eric André, Kid Cudi, Daveed Diggs', 'US', '2023-06-19 11:57:19.832000', 'Bộ phim mở ra cuộc hành trình phiêu lưu âm nhạc kỳ thú của bộ đôi Poppy và Branch. Sau 2 phần phim từng chiếu trước đây, trải qua những chuyến phiêu lưu cùng với nhau, Poppy và Brand đã chính thức ở bên nhau như một cặp đôi. Mở đầu trailer là khung cảnh của buổi tiệc cưới hoàng gia đang được chuẩn bị. Tụ hội trong ngày vui của vợ chồng Bridget và Gristle là anh Mây cầu vồng và Tí Kim Cương lấp lánh. Ngoài ra, còn có John Dory, anh trai thất lạc của Branch. Sự xuất hiện của John Dory tại bữa tiệc đã hé lộ những bí mật được che giấu lâu nay.', 120, 'https://cdn.discordapp.com/attachments/1058632154696921108/1106241367170105374/rZGFcl01VIdfMpLOIuiO6IFdq1U.png', 'VN', 'https://cdn.discordapp.com/attachments/1058632154696921108/1120209274119925760/maxresdefault.png', '2023-06-19 11:57:19.832000', '17/11/2023', 'Quỷ Lùn Tinh Nghịch: Đồng Tâm Hiệp Nhạc', 'https://www.youtube.com/watch?v=qZ40Z62tcXM');
